import React from 'react';

const Order = ({ selectedItems }) => {
  return (
    <div>
      <h1>Order Summary</h1>
      <ul>
        {selectedItems.map(item => (
          <li key={item.id}>
            <p>Name: {item.name}</p>
            <p>Price: ${item.price}</p>
            {/* Add more details if needed */}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default Order;
